function auth(){var e=new FormData($("#loginForm")[0]);$.ajax({type:"POST",url:"/login",data:e,contentType:!1,cache:!1,processData:!1,success:function(e){window.location.href=e.redirect},error:function(e){alertRequests("danger",e,"alert-login")}})}function alertRequests(e,a,t){$("#"+t).empty(),$("#"+t).append('<div class="alert alert-'+e+'" role="alert">'+a.responseJSON.messages+"</div>")}